import{_ as a,o as t,c as r,a5 as i}from"./chunks/framework.CUyCJeCc.js";const s="/assets/elementuiplus.DayhABva.png",n="/assets/datav.Cgt-j8Mp.png",o="/assets/iconpark.C80gOjqN.png",p="/assets/antv.CFPDYLTu.png",l="/assets/ViewDesign.CEXts2LU.png",h="/assets/animatecss.tQ-uHJ_i.png",c="/assets/apacheecharts.RqP5vYrW.png",d="/assets/vmdeditor.B_cjE4M5.png",u="/assets/aceeditor.H74APXdl.png",V=JSON.parse('{"title":"Vue3常用组件库","description":"","frontmatter":{"published":"2023-11-08T20:00:00.000Z","title":"Vue3常用组件库","author":"Flyinsky","image":"./imgs/elementuiplus.png","tags":["Vue"],"category":"前后端开发","categories":["Vue","Springboot"]},"headers":[],"relativePath":"Vue3WithVite/常用组件库.md","filePath":"Vue3WithVite/常用组件库.md","lastUpdated":null}'),m={name:"Vue3WithVite/常用组件库.md"};function _(g,e,b,f,k,v){return t(),r("div",{"data-pagefind-body":!0},e[0]||(e[0]=[i('<p>引言</p><p>本文记录我在进行Vue3开发时常用到的一些个人认为不错的组件库，作一个集合，也分享给大家，右侧有导航栏便大家浏览。</p><h2 id="_1-ui库" tabindex="-1">1.UI库 <a class="header-anchor" href="#_1-ui库" aria-label="Permalink to &quot;1.UI库&quot;">​</a></h2><h3 id="_1-element-ui-plus" tabindex="-1">(1).Element UI Plus <a class="header-anchor" href="#_1-element-ui-plus" aria-label="Permalink to &quot;(1).Element UI Plus&quot;">​</a></h3><p>介绍</p><p>这是一个老牌ui库，在许多网站上都能看到该组件库中的ui组件的身影。<a href="https://element-plus.org/zh-CN/" target="_blank" rel="noreferrer">官方文档</a></p><p><img src="'+s+'" alt=""></p><h3 id="_2-datav" tabindex="-1">(2).DataV <a class="header-anchor" href="#_2-datav" aria-label="Permalink to &quot;(2).DataV&quot;">​</a></h3><p>介绍</p><p>这是一个图表库，主题风格十分炫酷，广泛用于各大数据可视化项目。<a href="https://datav-vue3.netlify.app/" target="_blank" rel="noreferrer">官方文档</a></p><p><img src="'+n+'" alt=""></p><h3 id="_3-bytedance-iconpark" tabindex="-1">(3).ByteDance IconPark <a class="header-anchor" href="#_3-bytedance-iconpark" aria-label="Permalink to &quot;(3).ByteDance IconPark&quot;">​</a></h3><p>介绍</p><p>字节跳动团队维护的图标库，不仅图标可定制，可调节，且拥有丰富的插画库。<a href="https://iconpark.oceanengine.com/home" target="_blank" rel="noreferrer">官方文档</a></p><p><img src="'+o+'" alt=""></p><h3 id="_4-ant-desing-vue" tabindex="-1">(4).Ant Desing Vue <a class="header-anchor" href="#_4-ant-desing-vue" aria-label="Permalink to &quot;(4).Ant Desing Vue&quot;">​</a></h3><p>介绍</p><p>它与Element UI Plus类似，但设计更前卫，动画细节更丰富，功能更健全。相比之下Element UI Plus略逊。<a href="https://antdv.com/components/overview-cn" target="_blank" rel="noreferrer">官方文档</a></p><p><img src="'+p+'" alt=""></p><h3 id="_5-view-design" tabindex="-1">(5).View Design <a class="header-anchor" href="#_5-view-design" aria-label="Permalink to &quot;(5).View Design&quot;">​</a></h3><p>介绍</p><p>View Design也是一个UI组件库，它和Ant Design Vue类似，内置写好的登录表单等，更多选择的加载动画，以及更高级的选择器。<a href="https://www.iviewui.com/" target="_blank" rel="noreferrer">官方文档</a></p><p><img src="'+l+'" alt=""></p><h3 id="_6-animate-css" tabindex="-1">(6)Animate.css <a class="header-anchor" href="#_6-animate-css" aria-label="Permalink to &quot;(6)Animate.css&quot;">​</a></h3><p>介绍</p><p>Animate.css准确来说是一个集成了许多丰富过渡动画css的组件库，引入后为元素指定class即可完成对元素的入场、出场或其他状态下的动画。<a href="https://animate.style/" target="_blank" rel="noreferrer">官方文档</a></p><p><img src="'+h+'" alt=""></p><h3 id="_7-apache-echarts" tabindex="-1">(7)Apache ECharts <a class="header-anchor" href="#_7-apache-echarts" aria-label="Permalink to &quot;(7)Apache ECharts&quot;">​</a></h3><p>介绍</p><p>Apache ECharts是一个非常经典的第三方Javascript。当然，它在Vue3中也可以引入，并且只需要为其指定数据和图标类型，便能轻松做出花样图标。<a href="https://echarts.apache.org/zh/index.html" target="_blank" rel="noreferrer">官方文档</a></p><p><img src="'+c+'" alt=""></p><h3 id="_8-vue-ui-libs" tabindex="-1">(8)Vue Ui Libs <a class="header-anchor" href="#_8-vue-ui-libs" aria-label="Permalink to &quot;(8)Vue Ui Libs&quot;">​</a></h3><p>介绍</p><p>这是一个小型的Vue3+Ts环境下的ui库，主要包括动画按钮、3d展示卡片、爆炸彩屑等带有炫丽效果的组件。<a href="https://vueui.jiafengfmc.cn/" target="_blank" rel="noreferrer">官方文档</a></p><p>![](./imgs/vue cli libs.png)</p><h2 id="_2-组件库" tabindex="-1">2.组件库 <a class="header-anchor" href="#_2-组件库" aria-label="Permalink to &quot;2.组件库&quot;">​</a></h2><h3 id="_1-v-md-editor" tabindex="-1">(1).v-md-editor <a class="header-anchor" href="#_1-v-md-editor" aria-label="Permalink to &quot;(1).v-md-editor&quot;">​</a></h3><p>介绍</p><p>这是一个能够直接实现在网页上编辑，渲染markdown语言的组件，代码高亮，并且广泛支持插件和主题定制。<a href="https://code-farmer-i.github.io/vue-markdown-editor/zh/" target="_blank" rel="noreferrer">官方文档</a></p><p><img src="'+d+'" alt=""></p><h3 id="_2-aceeditor" tabindex="-1">(2).AceEditor <a class="header-anchor" href="#_2-aceeditor" aria-label="Permalink to &quot;(2).AceEditor&quot;">​</a></h3><p>介绍</p><p>这是一个代码编辑器组件，支持代码高亮，自动补全，AcWing同款。<a href="https://github.com/CarterLi/vue3-ace-editor" target="_blank" rel="noreferrer">Github</a></p><p><img src="'+u+'" alt=""></p>',44)]))}const P=a(m,[["render",_]]);export{V as __pageData,P as default};
